const landingPageStyle = {
    title: {
        marginTop: "30px",
        minHeight: "32px",
        color: "primary",
        textAlign: "center"
    },
    subtitle: {
        fontSize: "1.313rem",
        maxWidth: "500px",
        color: "secondary"
    },
    main: {
        marginTop: "100px",
        background: "#FFFFFF",
    },
    breadcrumbs: {
        background: 'primary'
    },
    img: {
        height: "480px",
        width: "854px"
    },
    h2: {
        color: 'primary',
        backgroundColor: 'primary'
    }
};

export default landingPageStyle;
